import React, {useState} from "react";
import { variable } from "../service/api";

const DropList = () =>{

    const [crypto, setCryp] = useState();

    return(
        <div className="App">            
            <select>
            {variable.menuItems.map((i) =>{
                <option>{i.title}</option>
            })}
            </select>
        </div>
    )
}

export default DropList;
